// WomenQuestionsData.js

export const womenQuestions = [
  {
    id: "w1",
    text: "Are you currently pregnant or breastfeeding?",
    mustBeFalse: true,
  },
  {
    id: "w2",
    text: "Have you experienced heavy menstrual bleeding recently?",
    mustBeFalse: true,
  },
  {
    id: "w3",
    text: "Have you had childbirth within the past 12 months?",
    mustBeFalse: true,
  },
];
